import React from 'react';
import Sidebar from './components/Sidebar';
import './App.css';
import './Media.css';


function App() {
  return (
    <div className="App all-page-background">
    <div className="wrap-main">
    <Sidebar />
    </div>
    </div>
  );
}

export default App;
